import React from "react";
import LogIn from "./login";
import SignIn from "./signin";


function StartPage(){

     let [newUser,setpage] = React.useState(false);
     
     function user(arg1){
          setpage(arg1);

          console.log(newUser);

          (newUser) ? setpage(<SignIn></SignIn>) : setpage(<LogIn></LogIn>)
     }


     return (
         <div>
             
             <button onClick={()=>{user(false)}}>Already hava an Account</button>
             <button onClick={()=>{user(true)}}>New user</button>

             {newUser}
         </div>
     )

}

export default StartPage;
